import React, {Component} from "react";
import './Coding2.css';
import img from './Coding_icon_here.png';

class Coding2 extends Component {
    render(){
        return(
            <div className="Coding-Main">
                <div className="Coding_padding_div">
                <img src={img} alt="React_image_here" width={'70px'} className="React_img"/>
                <h2 className="React_heading">React JS </h2><h2 className="React_heading">Web <h2></h2>Developer</h2> 
                </div>
                <h1>75%</h1>
                </div>
        )
    }
}

export default Coding2;
